import React from "react";
const ToDoList =(state)=>
{
    
        const {items,deleteItem} =state;
   
        const ListItems = items.map(item=>{
              
              return(
              <div key={item.id}>
                        <p>{item.name}</p>
                        <p>{item.age}</p>
                        <a href={deleteItem(item.id)}>&times;</a>

                </div>
              )
        })
    return(
        <div className="ListItems">

{ListItems}
</div>

      
        )
}
export default ToDoList;
